export default function Router() {
    const Layout = () => {
        return (
          <>
            <Header />
            <Outlet />
          </>
        )
    }
        return (
            <>
              <BrowserRouter>
                <Routes>
                  <Route path="/" element={<Layout />}>
                    <Route path="/" element={<Home />}  />
                    <Route path="Contact_Us" element={<Contact />}  /> 
                  </Route>
                </Routes>
              </BrowserRouter>
         
            </>  
          )
}
